import axios from 'axios';
import { useNavigate } from "react-router-dom";
import { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { fetchAllOrders } from "../../features/Order/OrderSlice";
import Product from './Product';
import Alert from '@mui/material/Alert';
import CircularProgress from '@mui/material/CircularProgress';
import ImageListItem from '@mui/material/ImageListItem';
import Box from '@mui/material/Box';
import ShopCart from './ShopCart';

const OrderList = () => {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchAllOrders());
    }, [dispatch]);

    const arrFromRedux = useSelector(state => state.orders.arrOrders);

    console.log(arrFromRedux);
  return (
    <div>
 <Box sx={{ margin: '0 auto', maxWidth: '95%' }}>
            <TableContainer component={Paper}>
                <Table className='table'>
                    <TableHead>
                        <TableRow>
                            <TableCell sx={{ backgroundColor: "#acdaff", color: "#004AAD" }} align="center"><b>name</b></TableCell>
                            <TableCell sx={{ backgroundColor: "#acdaff", color: "#004AAD" }} align="center"><b>phone</b></TableCell>
                            <TableCell sx={{ backgroundColor: "#acdaff", color: "#004AAD" }} align="center"><b>email</b></TableCell>
                            <TableCell sx={{ backgroundColor: "#acdaff", color: "#004AAD" }} align="center"><b>password</b></TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {arrFromRedux && arrFromRedux.map(
                            (order) => (
                                 <TableRow key={order.id}>
                                    <TableCell align="center">{order.username}</TableCell>
                                    <TableCell align="center">{order.address}</TableCell>
<ShopCart></ShopCart>
                                    <TableCell align="center">{order.orderSum}</TableCell>
                                </TableRow>
                            ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Box>
    </div>
  );
}

export default OrderList;
